import InventoryJacket from './Inventory/InventoryJacket.js';
import InventorySocks from './Inventory/InventorySocks.js';
import InventoryPants from './Inventory/InventoryPants.js';
import InventorySnowSet from './Inventory/InventorySnowSet.js';

import './App.css';

class App extends Component {

  render(){

  return (
    <div className="container">
      <h1>Stock Inventory</h1>
      <hr></hr>

      <div className="items">
 <InventoryJacket />
 <InventoryPants/>
 <InventorySnowSet/>
 <InventorySocks />
    </div>
    </div>
  )
}
}

export default App;
